import * as ActionTypes from "../Types";
import { postData } from "../services";

const onRegisterCompany = (payload) => {
  return {
    type: ActionTypes.REGISTER_COMPANY,
    payload,
  };
};

const onLogin = (payload) => {
  return {
    type: ActionTypes.LOGIN_COMPANY,
    payload
  }
}



export const registerCompany = (url, payload) => {
  return postData(url, payload, onRegisterCompany);
};

export const login = (url, payload) => {
  return postData(url, payload, onLogin)
}
